Surveying the major facts, concepts, theories, and speculations that infuse our present comprehension of time, the Encyclopedia of Time: Science, Philosophy, Theology, &amp; Culture explores the contributions of scientists, philosophers, theologians, and creative artists from ancient times to the present. By drawing together into one collection ideas from scholars around the globe and in a widerange of disciplines, this Encyclopedia will provide readers with a greater understanding of and appreciation for the elusive phenomenon experienced as time.

Title: Encyclopedia of Time: Science, Philosophy, Theology and Culture (3 Vol. Set)
Author: H. James Birx
Publisher: Sage Publications
Year: 2009
Format: PDF

